import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import MainLayout from "./layouts/MainLayout";
import Dashboard from "./pages/Dashboard";
import Subscription from "./admin/pages/Subscription"; 
import UserCenter from "./admin/pages/UserTable"; 
import MealClasses from "./admin/pages/MealClasses"; // Your component for Meal Classes
import MealTypes from "./admin/pages/MealTypes"; // Your component for Meal Types
import Meals from "./admin/pages/Meals";   
import Profile from "./admin/pages/Profile";   

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<MainLayout />}>
          <Route index element={<Dashboard />} />

          <Route path="subscription" element={<Subscription />} />
          <Route path="user_center" element={<UserCenter />} />
          <Route path="/admin/meal_classes" element={<MealClasses />} />
          <Route path="/admin/meal_types" element={<MealTypes />} />
          <Route path="/admin/meals" element={<Meals />} />
          <Route path="/admin/profile" element={<Profile />} />
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
